import './main.css';
import './keywords.css';

function Keyword() {
  return (
    <div>
       <h1 class="top-heading"> <img
                  src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
                  width="50"
                  height="55"
                  alt="MoodMelody Logo"
                /> MoodMelody </h1>
     <blockquote class="blockquote">
  <p>From Moments to Melodies <hr></hr> Create Stories fron Your Videos...</p>
</blockquote>
    </div>
  );
}
export default Keyword;
